import React, { useEffect, useState } from 'react';
import axios from 'axios';
import { Link } from 'react-router-dom';

const SolvedComplaints = ({ is_admin }) => {
  const [complaints, setComplaints] = useState([]);

  useEffect(() => {
    const getSolvedComplaints = async () => {
      try {
        let response;
        if (is_admin) {
          // Fetch all solved complaints for admin
          response = await axios.get('http://localhost:5000/complaints/solved');
        } else {
          // Fetch user-specific solved complaints
          response = await axios.get('http://localhost:5000/complaints');
        }
        setComplaints(response.data.complaints);
      } catch (error) {
        console.error(error);
      }
    };
    getSolvedComplaints();
  }, [is_admin]);

  return (
    <div>
      <h1>Çözümlenmiş Arızalar</h1>
      <table>
        <thead>
          <tr>
            <th>Arıza No</th>
            <th>Başlık</th>
            <th>Kaydı Oluşturan Kullanıcı</th>
            <th>Statü</th>
            <th>Detayları Gör</th>
          </tr>
        </thead>
        <tbody>
          {complaints.map((complaint) => (
            <tr key={complaint[0]}> {/* Assuming complaint[0] is the unique identifier (id) */}
              <td>{complaint[0]}</td>
              <td>{complaint[2]}</td>
              <td>{complaint[1]}</td> {/* Assuming complaint[1] is the username */}
              <td>{complaint[5]}</td>
              <td>
                <Link to={`/complaint/${complaint[0]}`}>Detayları Gör</Link>
              </td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default SolvedComplaints;
